    rev_id_current: null
    fields:
      body:
        -
          value: '<h2>Main Features</h2><ul><li>Easy Pokémon capture logging</li><li>Location and date tracking</li><li>Pokémon typing and optional photos</li><li>Publicly shareable diary URL</li></ul>'
          summary: ''
          format: basic_html
  -
    info: 'Social Proof'
    langcode: en
    uuid: cf0d7dc8-0478-4dc3-8f34-3e726976274b
    bundle: basic
    revision_id: null
    rev_id_current: null
    fields:
      body:
        -
          value: '<h2>Share our site and join the community</h2><p>Follow us on social media and share your Pokémon journey:</p><ul><li><a href="https://www.facebook.com">Facebook</a></li><li><a href="https://www.twitter.com">Twitter</a></li><li><a href="https://www.instagram.com">Instagram</a></li><li><a href="https://www.reddit.com">Reddit</a></li><li><a href="https://www.linkedin.com">LinkedIn</a></li></ul>'
          summary: ''
          format: basic_html
